import React from 'react'



 const ContactItem = ({contact}) => {
     const {id,name,email,phone}= contact
    return (
        <div className='card bg-light'>
            <h3 className='text-primary text-left'>{name}{''}</h3>
    <h4>{email}</h4>
    <h4>{phone}</h4>
        </div>
    )
}

export default ContactItem
